create table locacoes (
	cod_locacao INT PRIMARY KEY,
	dt_aluguel DATE,
	dias_locado INT,
	fk_cod_cliente INT,
	fk_cod_veiculo INT,
	fk_cod_filial INT,
	CONSTRAINT fk_cod_cliente FOREIGN KEY (fk_cod_cliente) REFERENCES cliente (cod_cliente),
	CONSTRAINT fk_cod_veiculo FOREIGN KEY (fk_cod_veiculo) REFERENCES veiculo (cod_veiculo), 
	CONSTRAINT fk_cod_filial FOREIGN KEY (fk_cod_filial) REFERENCES filial (cod_filial)
);

